import React from 'react';
import { connect } from 'redux-bundler-react';
import {
  Map,
  addData,
  basemapSwitcher,
  bookmarks,
  coordDisplay,
  draw,
  treeView,
  geocoder,
  identify,
  measureTools,
  rotateNorth,
  zoomInOut,
  zoomHome,
  zoomToBox
} from "@corpsmap/corpsmap";
import "@corpsmap/corpsmap/css/corpsmap.css";

class MapPage extends React.Component {
  render(){
    return (
      <div >
        <nav className="navbar navbar=expand-lg navbar-dark bg-primary">
          <a className="navbar-brand" href="/">AEP Map</a>
        </nav>
        <div className="container-fluid" style={{ padding: 0 }}>
            <Map
              theme="grey-cararra"
              plugins={[
                addData,
                basemapSwitcher,
                bookmarks,
                coordDisplay,
                draw,
                treeView,
                geocoder,
                identify,
                measureTools,
                rotateNorth,
                zoomInOut,
                zoomHome,
                zoomToBox
              ]}
            />        
        </div>
      </div>
    )
  }
}
export default connect(
  'doMapInitialize',
  MapPage
  );
